import React, { Component } from 'react';
import Header from '../header/header';
import Heading from './heading/heading';

class Typography extends Component {
    constructor(props)
  {
      super(props)
      this.state = {
         header: [
            {title: 'Typography'}
          ],
          heading: [
            {
                tname: 'h1',
                cante: 'We develop software',
                style: 'h1',

            }
        ]
      }

  }   

    render() {
        return (
             <div class="wrapper">
                 <section class="container">
                     <div className="row">
                     <Header header={this.state.header[0].title} />
                     <Heading 
                         tname={this.state.heading[0].tname} 
                         style={this.state.heading[0].style}
                         cante={this.state.heading[0].cante}
                    />
                     </div>
                </section>
            </div>
        );
    }
}

export default Typography;
